soft Pay and the Payment Request API.'=>'Integruje platby PayPal a platební karty (Stripe). Integrace Stripe podporuje platby kartou 3D Secure, Apple Pay, Google Pay, Microsoft Pay a Payment Request API.','BABE Backoffice'=>'BABE backoffice','Management tools: PDF invoices, backend bookings, editing/cancellation orders, extra charge, full and partial refund, iCal synchronization, export orders to xlsx, emails and order status router customizer.'=>'Nástroje pro správu: PDF faktury, backend rezervace, úpravy/stornování objednávek, extra poplatky, plné a částečné vrácení peněz, synchronizace iCal, export objednávek do xlsx, přizpůsobení emailů a směrování stavů objednávek.','BABE Currency switcher'=>'BABE Currency switcher','Currency switcher widget. Options: force booking and checkout in the base currency, turn on payment gateways on the checkout depending on currency.'=>'Widget pro přepínání měn. Možnosti: vynucení rezervace a pokladny v základní měně, zapnutí platebních bran na pokladně v závislosti na měně.','BABE Marketplace'=>'BABE marketplace','Multi Vendor Marketplace extension for BA Book Everything plugin transforms your booking site into a marketplace.'=>'Rozšíření Multi Vendor Marketplace pro plugin BA Book Everything promění tvůj rezervační web na tržiště.','BABE Payment Bank transfer'=>'BABE Payment Bank transfer','Added a Bank transfer payment option: show bank transfer details on checkout, order confirmation and in the customer email.'=>'Přidána možnost bankovního převodu: zobrazení údajů pro bankovní převod při pokladně, potvrzení objednávky a v emailu zákazníkovi.','20+ Payment Gateways'=>'20+ platebních bran','Check our ready-made integrations with over 20 payment gateways.'=>'Podívej se na naše hotové integrace s více než 20 platebními branami.','Learn more'=>'Zjistit více','Management tools: PDF invoices, backend bookings, editing/cancelation orders, extra charge, full and partial refund, iCal synchronization.'=>'Nástroje pro správu: PDF faktury, b